import React, { Componenet } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Componenet  {
  render(){
      return (
        <div className="gray-background">
            <img src={logo} lat="logo" />
            <h2>Let's develop management system!</h2>
        </div>
      );
  }  
}

export default App;
